import React from "react";
import "./Home.css";

function Home() {
  return (
    <section id="home" class="section">
        <div class="container">
            <h2>About Me</h2>
            <p>As an experienced programmer mainly for Roblox, with over 6 years of experience, I specialize in creating complex performance-friendly systems and more. My goal is to always deliver the best quality work for my clients.</p>
        </div>
    </section>
  );
}

export default Home;
